import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  font-family: Roboto;
  font-style: normal;

  .gatherTop {
    font-weight: 500;
    font-size: 24px;
    line-height: 28px;
    display: flex;
    align-items: center;
    text-align: center;
    letter-spacing: -0.015em;
  }
`;

const Gather = (props) => { // N개의 독서 모임
  return (
    <>
      <Wrapper>
        <div>
          <p className="gatherTop">N개의 독서 모임, 마진 탑 100px</p>
          <span>
            모집중
            최신순
          </span>
        </div>
      </Wrapper>
      
      <h4>이하 컴포넌트</h4>
    </>
  )
};

export default Gather;
